sprites.onOverlap(SpriteKind.Player, SpriteKind.EnemyProjectile, function (sprite, otherSprite) {
	
})
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.Boss, function (sprite, otherSprite) {
    otherSprite.startEffect(effects.spray, 200)
    sprite.destroy()
    if (!(bossInvulnerable)) {
        sprites.changeDataNumberBy(otherSprite, "hp", -1)
        cubicbird.displayHitPointBar(sprites.readDataNumber(otherSprite, "hp") / bossMaxHp * 100)
        if (sprites.readDataNumber(otherSprite, "hp") == 0) {
            game.over(false)
        } else if (sprites.readDataNumber(boss, "hp") % 3 == 1) {
            bossAngerAttack()
        }
    }
})
function moveBoss () {
    if (boss.x > 150) {
        boss.vx = -30
    }
    if (boss.x < 40) {
        boss.vx = 30
    }
    if (boss.y > 110) {
        boss.vy = -30
    }
    if (boss.y < 10) {
        boss.vy = 30
    }
}
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.Enemy, function (sprite, otherSprite) {
    otherSprite.startEffect(effects.ashes, 200)
    sprite.destroy()
    sprites.changeDataNumberBy(otherSprite, "hp", -1)
    cubicbird.displaySpriteHitPointBar(otherSprite, sprites.readDataNumber(otherSprite, "hp") / 3 * 100)
    if (sprites.readDataNumber(otherSprite, "hp") == 0) {
        info.changeScoreBy(1)
        otherSprite.destroy()
    }
})
